/**
 * User class which represents all methods which can be performed with a User.
 * Reflects the Database structure
 * Use to construct user only if they come from intranet (verified) or admin requests
 * @export
 * @class User
 * @extends {BaseModel}
 */
export class User extends BaseModel implements IUser {
    public static tableName = 'users';
    public id: number; //self id (uuid v4 (random))
    public username?: string;
    public first_name?: string;  //user first name
    public last_name?: string;  //user last name
    public email?: string;  //user email
    public password_hash?: string; //string of user granted permissions
    public salt: string = 'null';
    public facebook_id?: string; //big integer as string as per FB documentation
    public facebook_token?: string; //for gamefication
    public facebook_permissions?: string[];
    public twitter_token?: string;  //for gamefication
    public user_roles: IUserPermissions; //for adjusting permissions
    public avatar?: string;  //general avatar url
    public verification_photo?: string;  //verification photo
    public linkedin_token?: string;
    public linkedin_id?: string;
    public state_id?: string;
    public state_id_issue_date?: Date;
    public country?: string;
    public city?: string;
    public address?: string;
    public state?: string;
    public zip_code?: string;
    public phone?: string;
    public gender?: string;
    public birth?: Date;
    public utm?: string;
    public status_id?: UserStatus
    public referrer?: string;
    public campaign?: string;
    public wordpress_id?: string;
    public wordpress_username?: string;
    public wordpress_token?: string;
    public last_login?: IUserLogin
    public created?: Date //date created
    public updated?: Date //date updated
    public deleted?: Date  //date deleted
    [key: string]: any
    /**
     * 
     * 
     * @private
     * @param {(string|undefined)} string 
     * @returns {(string|undefined)} 
     * @memberof User
     */
    private check_email(email?: string): string | undefined {
        if (!isString(email)) return undefined
        return isEmail(email) ? email : undefined

    }
    /**
     * Creates an instance of User.
     * @param {Partial<User>} init 
     * 
     * @memberof User
     */
    constructor(init: IUser) {
        super();
        this.id = init.id;
        this.username = init.username;
        this.first_name = init.first_name;
        this.last_name = init.last_name;
        this.email = this.check_email(init.email);
        this.password_hash = init.password_hash;
        this.salt = init.salt || this.uuid;
        this.facebook_id = init.facebook_id;
        this.facebook_token = init.facebook_token;
        this.facebook_permissions = init.facebook_permissions;
        this.twitter_token = init.twitter_token;
        this.user_roles = init.user_roles;
        this.avatar = init.avatar;
        this.verification_photo = init.verification_photo;
        this.linkedin_token = init.linkedin_token;
        this.linkedin_id = init.linkedin_id;
        this.state_id = init.state_id;
        this.state_id_issue_date = init.state_id_issue_date;
        this.country = init.country;
        this.city = init.city;
        this.address = init.address;
        this.phone = init.phone;
        this.gender = init.gender;
        this.birth = init.birth;
        this.utm = init.utm;
        this.status_id = init.status_id;
        this.wordpress_id = init.wordpress_id;
        this.wordpress_username = init.wordpress_username;
        this.wordpress_token = init.wordpress_token;
        this.referrer = init.referrer;
        this.created = init.created || new Date();
        this.updated = init.updated;
        this.deleted = init.deleted;
    }
    /**
     * Async Generates random salt string
     * 
     * @returns void
     * 
     * @memberof User
     */
    public async generateSalt(): Promise<void> {
        this.salt = await generateRandomString()
    }

    /**
     * Async Verifies provided password with the stored hash
     * 
     * @param {User} user 
     * @param {string} password 
     * @returns {Promise<boolean>} 
     * 
     * @memberof User
     */
    public async verifyPassword(password: string, user: User = this): Promise<boolean> {
        return compareHashes(user.password_hash, await generatePBKDF2Key(password, user.salt))
    }

    /**
     * Async Generates Salat and Password Hash and attaches them to the User
     * 
     * @param {string} password 
     * 
     * @memberof User
     */
    public async generateSaltAndHash(password: string) {
        this.salt = this.salt ? this.salt : await generateRandomString()
        this.password_hash = await generatePBKDF2Key(password || 'defaultpassword', this.salt)
    }
    /**
     * Sync Checks if the user is Admin
     * 
     * @returns {boolean} 
     * 
     * @memberof User
     */
    public isAdmin(): boolean {
        return UserRoles.includesAdminPermission(this.user_roles)
    }

    public async getLastLogin() {
        this.last_login = await new UserLogin({ user_id: this.id }).getLast();
    }
    public async applySettings(user: IUser):Promise<IUser> {
        this.first_name = user.first_name;
        this.last_name = user.last_name;
        this.facebook_id = user.facebook_id;
        this.facebook_permissions = user.facebook_permissions;
        this.twitter_token = user.twitter_token;
        this.user_roles = user.user_roles;
        this.avatar = user.avatar;
        this.verification_photo = user.verification_photo;
        this.linkedin_token = user.linkedin_token;
        this.linkedin_id = user.linkedin_id;
        this.state_id = user.state_id;
        this.state_id_issue_date = user.state_id_issue_date;
        this.country = user.country;
        this.city = user.city;
        this.address = user.address;
        this.phone = user.phone;
        this.gender = user.gender;
        this.birth = user.birth;
        this.utm = user.utm;
        this.status_id = user.status_id;
        this.wordpress_token = user.wordpress_token;
        this.referrer = user.referrer;
        return this.update();
    }
    /**
     * Async Static Find Users in DB by UUID
     * 
     * @static
     * @param {string} uuid 
     * @returns {(Promise<User | undefined>)} 
     * 
     * @memberof User
     */
    public static async findByUUID(id: number): Promise<User | undefined> {
        return User.findOne(<any>User, { id: id });
    }
    /**
     * Async Static Find one User in DB by email
     * 
     * @static
     * @param {string} email 
     * @returns {(Promise< User | undefined>)} 
     * 
     * @memberof User
     */
    public static findUserByEmail(email: string): Promise<User | undefined> {
        return User.findOne(<any>User, { email: email });
    }
}

/**
 * Sanitized User Model is used to construct a user without any security violation
 * Use it to construct new user model received from internet
 * @export
 * @class UserSanitized
 * @extends {User}
 */
export class UserSanitized extends User {
    public constructor(init: IUser) {
        init.user_roles = UserRoles.GetUserPermissions
        super(init)
    }
}

/**
 * Public User Model returns a publically available version of the Model (for security reasons)
 * 
 * @export
 * @class PublicUserModel
 */
export class PublicUserModel implements IPublicUser {
    public id: number;
    public username?: string;
    public first_name?: string;
    public last_name?: string;
    public email?: string;
    public facebook_connected?: boolean;
    public linkedin_connected?: boolean;
    public avatar: string | undefined;  //general avatar url
    public verification_photo: string | undefined;  //verification photo
    public state_id?: string;
    public state_id_issue_date?: Date;
    public country?: string;
    public city?: string;
    public address?: string;
    public phone?: string;
    public gender?: string;
    public birth?: Date;
    public user_roles: IUserPermissions;
    public facebook_id: string | undefined; //big integer as string as per FB documentation
    public linkedin_id: string | undefined
    public wordpress_id: string | undefined
    public wordpress_username: string | undefined
    public utm?: string;
    public referrer?: string;
    public is_verified: boolean
    public created?: Date
    public status_id?: UserStatus
    public last_login?: IUserLogin
    public full_count?: number

    /**
     * Creates an instance of PublicUserModel.
     * Constructs a secured version of User model
     * @param {User} user 
     * 
     * @memberof PublicUserModel
     */
    public constructor(user: IUser) {
        this.id = user.id;
        this.username = user.username;
        this.first_name = user.first_name;
        this.last_name = user.last_name;
        this.email = user.email;
        this.facebook_connected = user.facebook_id ? true : false;
        this.linkedin_connected = user.linkedin_id ? true : false;
        this.avatar = user.avatar;
        this.verification_photo = user.verification_photo;
        this.user_roles = user.user_roles || UserRoles.GetUserPermissions;
        this.state_id = user.state_id;
        this.state_id_issue_date = user.state_id_issue_date;
        this.city = user.city;
        this.country = user.country;
        this.address = user.address;
        this.phone = user.phone;
        this.gender = user.gender;
        this.birth = user.birth;
        this.facebook_id = user.facebook_id;
        this.linkedin_id = user.linkedin_id;
        this.wordpress_id = user.wordpress_id;
        this.wordpress_username = user.wordpress_username;
        this.utm = user.utm;
        this.referrer = user.referrer;
        this.is_verified = PublicUserModel.verifyUser(user);
        this.created = user.created;
        this.status_id = user.status_id;
        this.full_count = user.full_count;
    }
    public static verifyUser(user: IPublicUser | IUser): boolean {
        if (
            user.email &&
            (user.facebook_id || user.linkedin_id) &&
            user.first_name &&
            user.last_name &&
            user.verification_photo
        ) return true
        return false
    }

    public async getLastLogin() {
        this.last_login = await new UserLogin({ user_id: this.id }).getLast();
    }
}

